import React from 'react';
import { useNavigate } from 'react-router-dom';
import {useLocation} from 'react-router-dom';

export default function ListingPage(){
    const next = useNavigate();
    const location = useLocation();
    function submitfn() {
        var startLocation = ((document.getElementById("start") as HTMLInputElement).value);
        var endLocation = ((document.getElementById("end") as HTMLInputElement).value);
        console.log(startLocation,endLocation);
        fetchData();
      }
    return <div>Home
        <button onClick={() => { next("/details") }}>lsitingpage</button>
        <div><a onClick={submitfn}>{location.state.buses_list[0].bus_id}</a>,{location.state.buses_list[0].Arr_Time},{location.state.buses_list[0].Dep_Time}</div>
        <div>{location.state.buses_list[1].bus_id},{location.state.buses_list[1].Arr_Time},{location.state.buses_list[1].Dep_Time}</div>

    </div>}
